import React from 'react';
import Logo from '../common/Logo';
import { motion } from 'framer-motion';

interface AuthLayoutProps {
  children: React.ReactNode;
  title: string;
  subtitle?: string;
}

const AuthLayout: React.FC<AuthLayoutProps> = ({ children, title, subtitle }) => {
  return (
    <div className="min-h-screen relative overflow-hidden bg-gradient-to-br from-indigo-600 via-purple-600 to-pink-500">
      {/* Animated background elements */}
      <div className="absolute inset-0 overflow-hidden">
        <div className="absolute w-full h-full bg-[url('data:image/svg+xml;base64,')] opacity-30" />
        <motion.div
          className="absolute -top-1/2 -left-1/2 w-full h-full bg-gradient-to-br from-blue-500/20 to-purple-500/20 rounded-full blur-3xl"
          animate={{
            scale: [1, 1.2, 1],
            rotate: [0, 90, 0],
          }}
          transition={{
            duration: 20,
            repeat: Infinity,
            ease: "linear"
          }}
        />
        <motion.div
          className="absolute -bottom-1/2 -right-1/2 w-full h-full bg-gradient-to-br from-pink-500/20 to-indigo-500/20 rounded-full blur-3xl"
          animate={{
            scale: [1.2, 1, 1.2],
            rotate: [90, 0, 90],
          }}
          transition={{
            duration: 20,
            repeat: Infinity,
            ease: "linear"
          }}
        />
      </div>

      {/* Content */}
      <div className="relative min-h-screen flex items-center justify-center p-4">
        <div className="w-full max-w-6xl grid md:grid-cols-2 gap-8 items-center">
          {/* Left side - Branding */}
          <motion.div 
            initial={{ opacity: 0, x: -20 }}
            animate={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.5 }}
            className="hidden md:flex flex-col items-start justify-center space-y-8 pr-8"
          >
            <motion.div 
              className="flex items-center space-x-4"
              whileHover={{ scale: 1.05 }}
              transition={{ type: "spring", stiffness: 400, damping: 10 }}
            >
              <Logo className="w-16 h-16 text-white" />
              <h1 className="text-4xl font-bold text-white">RoomieSync</h1>
            </motion.div>
            <div className="space-y-6">
              <motion.h2 
                className="text-3xl font-medium text-white/90"
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ delay: 0.2 }}
              >
                Your Smart Living Space Assistant
              </motion.h2>
              <motion.p 
                className="text-xl text-white/80 leading-relaxed"
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ delay: 0.3 }}
              >
                Experience seamless roommate coordination with our all-in-one platform. Join thousands of happy users managing their shared spaces effortlessly.
              </motion.p>
              <motion.div 
                className="flex flex-col space-y-4"
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ delay: 0.4 }}
              >
                {[
                  { icon: "âœ¨", text: "Smart chore management" },
                  { icon: "ðŸ•’", text: "Schedule coordination" },
                  { icon: "ðŸ‘¥", text: "Guest management" },
                  { icon: "ðŸ’¬", text: "Real-time chat" },
                  { icon: "ðŸ“Š", text: "Expense tracking" },
                  { icon: "ðŸ””", text: "Smart notifications" }
                ].map((feature, index) => (
                  <motion.div 
                    key={index}
                    className="flex items-center space-x-3 bg-white/10 rounded-xl p-3 backdrop-blur-sm"
                    whileHover={{ scale: 1.02, backgroundColor: "rgba(255,255,255,0.15)" }}
                    transition={{ type: "spring", stiffness: 400, damping: 10 }}
                  >
                    <span className="text-2xl">{feature.icon}</span>
                    <span className="text-white/90">{feature.text}</span>
                  </motion.div>
                ))}
              </motion.div>
            </div>
          </motion.div>

          {/* Right side - iPhone Frame & Auth Form */}
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.5, delay: 0.2 }}
            className="w-full max-w-[375px] mx-auto"
          >
            {/* iPhone Frame */}
            <div className="relative mx-auto border-[14px] border-black rounded-[2.5rem] h-[600px] max-w-[375px] shadow-xl">
              <div className="absolute top-0 w-full h-6 bg-black">
                <div className="absolute top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 w-20 h-4 bg-black rounded-full">
                  <div className="absolute top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 w-12 h-1 bg-gray-800 rounded-full"></div>
                </div>
              </div>
              {/* Screen Content */}
              <div className="relative w-full h-full overflow-y-auto bg-gradient-to-br from-gray-900 to-gray-800 rounded-xl">
                <div className="p-6">
                  <div className="md:hidden flex items-center justify-center space-x-4 mb-8">
                    <Logo className="w-12 h-12 text-white" />
                    <h1 className="text-2xl font-bold text-white">RoomieSync</h1>
                  </div>
                  <div className="text-center mb-8">
                    <motion.h2 
                      className="text-2xl font-bold text-white"
                      initial={{ opacity: 0, y: -20 }}
                      animate={{ opacity: 1, y: 0 }}
                      transition={{ delay: 0.3 }}
                    >
                      {title}
                    </motion.h2>
                    {subtitle && (
                      <motion.p 
                        className="mt-3 text-sm text-white/80"
                        initial={{ opacity: 0, y: -20 }}
                        animate={{ opacity: 1, y: 0 }}
                        transition={{ delay: 0.4 }}
                      >
                        {subtitle}
                      </motion.p>
                    )}
                  </div>
                  <motion.div 
                    className="backdrop-blur-sm"
                    initial={{ opacity: 0, scale: 0.95 }}
                    animate={{ opacity: 1, scale: 1 }}
                    transition={{ delay: 0.5 }}
                  >
                    {children}
                  </motion.div>
                </div>
              </div>
              {/* Home Indicator */}
              <div className="absolute bottom-1 left-1/2 transform -translate-x-1/2 w-28 h-1 bg-gray-800 rounded-full"></div>
            </div>
          </motion.div>
        </div>
      </div>
    </div>
  );
};

export default AuthLayout;
